import { ClienteslistComponent } from './clienteslist/clienteslist.component';
import { FormsModule } from '@angular/forms';


@NgModule({
  declarations: [
    ClientesFormComponent,
    ClienteslistComponent
  ],
  imports: [
    CommonModule,
    ClientesRoutingModule,
    FormsModule
  ],
  exports:[
    ClientesFormComponent   
  ]
